import { useNavigate } from 'react-router-dom'; // Import useNavigate from React Router
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';
import apple from '../components/images/apple.png';
import google from '../components/images/google.png';

const Signin = () => {
  const navigate = useNavigate(); // Initialize navigate

  const [user, setUser] = useState({ username: "" }); // State for username

  // Define the list of registered usernames
  const registeredUsernames = [{user}]; // Replace with your registered usernames

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Entered username:", user.username);
    console.log("Registered usernames:", registeredUsernames);
    navigate('/signflow');
    // Check if the entered username exists in the list of registered usernames
    if (registeredUsernames.includes(user.username)) {
      // Store the username in sessionStorage
      sessionStorage.setItem("username", user.username);
      // Redirect to "/signflow" for password confirmation

    } try {
      // Display an error message if the username is not registered
      console.log("Username is registered");}

      catch{
        console.log("username is not registered")
      }

  };

  return (
      <div className="logo-box">
        <img src={black_x} alt="black" className="logo" />
        <h2>Sign In to Twitter</h2>
